const Dashboard = () => {

    const pageWrapper = {
  
      display: "flex",
      flexDirection: "column",
      minHeight: "90vh",
      backgroundColor: "#e3e3ed",
  
    }

    const titleText = {
  
      color: "black",
      fontSize: "2em",
      padding: "10%",
      textDecoration: "underline"
  
    }

  
    return (
      <div id = "dashboard" style = {pageWrapper}>
        <h1 style = {titleText}>dashboard.</h1>
      </div>
    );
    
};
    
export default Dashboard;
